import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Navbar2 from "./Navbar2";
import { Link } from "react-router-dom";

const Managerform=()=>{
    const navigate = useNavigate();
    const [manager,setmanager]=useState(
        {
            firstName:"",
            lastName:"",
            emailId:"",
            managerId:"",
            password:"",
            role:""
           
        }
    )
    const { firstName,lastName, emailId,managerId,password,role}=manager
    const onInputChange=(e)=>{
        setmanager({...manager,
            [e.target.name]:e.target.value
        });
    }
    const handleSubmit= async (e)=>{
     e.preventDefault();
     await axios.post(`http://localhost:8080/admin/manager/addmanager`,{
        "firstName":firstName,
        "lastName":lastName,
        "emailId":emailId,
        "managerId":managerId,
        "password":password,
        "role":role,
    }
     )
     .then(res=>{
        console.log(res.data)
        if(res.status===404){
            alert(res.data)
        }
    })
    .catch(error=>{
        console.log(error)
    })
    navigate("/Addemployee");
  
    };
    return (
        <div>
            <Navbar2></Navbar2>
        <div className="container">
            <div className="row">
                <div  className="col-md-6 offset-md-3 border rounded p-4 mt-2 shadow">
                    <h2  className="text-center m-4"> Register Manager  </h2>
                    <form onSubmit={(e)=>handleSubmit(e)}>
                    <div className="mb-3">

                        <label htmlFor="FirstName" className="form-label">FirstName</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your manager firstname"
                        name="firstName"
                        value={firstName}
                        onChange={onInputChange}
                        ></input>
                    </div>
                    <div className="mb-3">
                        <label htmlFor="LastName" className="form-label">LastName</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your managerlastname"
                        name="lastName"
                        value={lastName}
                        onChange={onInputChange}
                        ></input>
                    </div>
                    <div className="mb-3">
                        <label htmlFor="EmailId" className="form-label">EmailId</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="emailId"
                        value={emailId}
                        onChange={onInputChange}
                        ></input>
                    </div>
                    <div className="mb-3">
                        <label htmlFor="managerId" className="form-label">managerId</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your managerId"
                        name="managerId"
                        value={managerId}
                        onChange={onInputChange}
                        ></input>
                    </div>
                    <div className="mb-3">
                        <label htmlFor="password" className="form-label">Password</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your password"
                        name="password"
                        value={password}
                        onChange={onInputChange}
                        ></input>
                    </div>
                    <div className="mb-3">
                        <label htmlFor="role" className="form-label">Role</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your role"
                        name="role"
                        value={role}
                        onChange={onInputChange}
                        ></input>
                    </div>
                    {/* <div className="mb-3">
                        <label htmlFor="dateOfBirth" className="form-label">dateOfBirth</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="dateOfBirth"
                        value={dateOfBirth}
                        onChange={dateOfBirthhandler}
                        ></input>
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="address" className="form-label">address</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="address"
                        value={address}
                        onChange={addresshandler}
                        ></input>
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="city" className="form-label">city</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="city"
                        value={city}
                        onChange={cityhandler}
                        ></input>
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="state" className="form-label">state</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="state"
                        value={state}
                        onChange={statehandler}
                        ></input>
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="pinCode" className="form-label">pinCode</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="pinCode"
                        value={pinCode}
                        onChange={pinCodehandler}
                        ></input>
                        
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="country" className="form-label">country</label>
                        <input
                        type={"text"}
                        className="form-control"
                        placeholder="Enter your emailid"
                        name="country"
                        value={country}
                        onChange={countryhandler}
                        ></input>
                    </div> */}
                    <button>Submit</button>
                    {/* <Link to="/"type="submit" className="btn btn-success">Submit</Link> */}
                    <Link to="/Addemployee"type="submit" className="btn btn-outline-danger mx-2">Cancel</Link>
                    </form>
                </div>

            </div>
        </div> 
        </div>
    );
    
}
export default Managerform;
